content="-> Devops!!\n* Well connected specialists\n* A cultural and professional movement, focused on how we build and operate high velocity organizations, born from the experience of its practitioners.\n\n# Principles\n* Build\n* Operate\n* High velocity\n* Design -> Safety, Contentment, Knowledge and Freedom/\n\n- DevOps is real\n- I know it by its universal principles\n- I practice it by its shared forms\n- I apply it to my daily work\n- My practice is unique\t\n\n# Forms\n\nWrite down your purpose\nWrite down your beliefs\nEmpower the team to act\nBe available for context\n\n## Testing (Dig this)\nUnit test (single function)\nIntegration test (multiple classes/units)\nFunctional test (user-oriented, high level, full stack)\nSmoke test (Quickly determine if the system is \"working\")\n\n* Failure is inevitable; it's how you detect and react that matter most\n\n# Application\n\n8 week project"
